import React, { useState } from "react";
import CustomInput from "../components/CustomInput";

const RegisterPage = () => {
  const [name, setName] = useState("");

  return (
    <div
      style={{
        marginTop: 100,
        maxWidth: 350,
        marginLeft: "auto",
        marginRight: "auto",
      }}
    >
      <h3>Register</h3>
      <form>
        <CustomInput label="name" value={name} setValue={setName} />
      </form>
    </div>
  );
};

export default RegisterPage;
